import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import BuilderPage from './BuilderPage';

function ApiTestPage() {
  const [message, setMessage] = useState('');

  useEffect(() => {
    axios.get('http://localhost:8000/api/disasters')
      .then(response => {
        console.log(response.data);
        setMessage('APIつながったよ！');
      })
      .catch(error => {
        console.error('APIエラー:', error);
        setMessage('APIエラーが発生しました');
      });
  }, []);

  return (
    <div style={{ padding: 20 }}>
      <h1>Laravel API との接続テスト</h1>
      <p>{message}</p>
    </div>
  );
}

function App() {
  return (
    <BrowserRouter>
      <nav style={{ padding: 10, background: '#f5f5f5' }}>
        <Link to="/" style={{ marginRight: 10 }}>APIテスト</Link>
        <Link to="/builder">Builderページ</Link>
      </nav>

      <Routes>
        <Route path="/" element={<ApiTestPage />} />
        <Route path="/builder/*" element={<BuilderPage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
